import React from "react";
import { Link } from "react-router-dom";

import './main.css';
let Main = props => {
  const {onClick} = props;
  return(
    <div className="button-navs">
      <Link to='/cards'><button>New Game</button> </Link>
      <button>View History</button>
      <button>View Notes</button>
      <button>New Training</button>


    </div>
  )
}

export default Main;
